import React, { Component } from 'react'

class ListaChicotes extends Component{
    render(){
        return(
            <section>
            <ul>
                <li>CNV-96</li>
                <li>CNV-97</li>
                <li>CNV-98</li>
                <li>CNV-99</li>
            </ul>
            </section>
        )
    }
}
export default ListaChicotes
